void initWaveShaper(WaveShaperDataType * data,const WaveShaperDataTypeRO* copyFrom)
{
    data->transferFunctionPoints = (float*)copyFrom->transferFunctionPoints;
}

void initMultiWaveShaper(MultiWaveShaperDataType * data,const MultiWaveShaperDataTypeRO *copyFrom)
{
    for(uint8_t c=0;c<64;c++)
    {
        data->transferFunctions[c]=(float*)copyFrom->transferFunctions[c];
    }
    data->functionIndex=0;
}

float multiWaveShaperProcessSample(float sampleIn,MultiWaveShaperDataType*data)
{
    int32_t indx;
    float v1,v2,rem,factor,indexfloat;
    indexfloat = ((sampleIn+1.0f)*(float)(WAVESHAPER_CURVE_LENGTH/2));
    indx = (int32_t)indexfloat; 
    if (indx > (WAVESHAPER_CURVE_LENGTH-1))
    {
        indx=(WAVESHAPER_CURVE_LENGTH-1);
    }
    else if (indx < 0)
    {
        indx=0;
    }
    v1 = data->transferFunctions[data->functionIndex][indx];
    v2 = data->transferFunctions[data->functionIndex][indx+1];
    rem = indexfloat-((float)indx);
    factor = (v1 + (v2-v1)*rem);
    return factor;
}

float waveShaperProcessSample(float sampleIn,WaveShaperDataType*data)
{
    int32_t indx;
    float v1,v2,rem,factor,indexfloat;
    indexfloat = ((sampleIn+1.0f)*64.0f);
    indx = (int32_t)indexfloat; // rescale to 0-127
    if (indx > 127)
    {
        indx=127;
    }
    else if (indx < 0)
    {
        indx=0;
    }
    v1 = data->transferFunctionPoints[indx];
    v2 = data->transferFunctionPoints[indx+1];
    rem = indexfloat-((float)indx);
    factor = (v1 + (v2-v1)*rem);
    return factor;
}

